// RegistrationForm.js
import React, { useState } from 'react';
import './App.css'; // Import the CSS file

const App = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    website: '',
    imagelink: '',
    gender: 'male',
    skills: {
      js: false,
      CSS: false,
      python: false,
    },
  });

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData((prevData) => {
      if (type === 'checkbox') {
        return {
          ...prevData,
          skills: {
            ...prevData.skills,
            [name]: checked,
          },
        };
      } else {
        return {
          ...prevData,
          [name]: value,
        };
      }
    });
  };

  const handleEnroll = () => {
    // Display the form data on the console for demonstration purposes
    console.log('Enrolled Student:', formData);
    // You can add logic here to store the data, make an API call, etc.
  };

  const handleClear = () => {
    // Clear the form data
    setFormData({
      name: '',
      email: '',
      website: '',
      imagelink: '',
      gender: 'male',
      skills: {
        js: false,
        CSS: false,
        python: false,
      },
    });
  };

  return (

    <div className="bg-container">
      <div className='reg-card'>
      <h2>Registration Form</h2>
      <form>
        <div>
          <label>Name:</label>
          <input type="text" name="name" value={formData.name} onChange={handleChange} />
        </div>
        <div>
          <label>Email:</label>
          <input type="email" name="email" value={formData.email} onChange={handleChange} />
        </div>
        <div>
          <label>Website:</label>
          <input type="text" name="website" value={formData.website} onChange={handleChange} />
        </div>
        <div>
          <label>Image Link:</label>
          <input type="text" name="imagelink" value={formData.imagelink} onChange={handleChange} />
        </div>
        <div>
          <label>Gender:</label>
          <select name="gender" value={formData.gender} onChange={handleChange}>
            <option value="male">Male</option>
            <option value="female">Female</option>
          </select>
        </div>
        <div>
          <label>Skills:</label>
          <label>
            <input
              type="checkbox"
              name="js"
              checked={formData.skills.js}
              onChange={handleChange}
            />
            JavaScript
          </label>
          <label>
            <input
              type="checkbox"
              name="CSS"
              checked={formData.skills.CSS}
              onChange={handleChange}
            />
            CSS
          </label>
          <label>
            <input
              type="checkbox"
              name="python"
              checked={formData.skills.python}
              onChange={handleChange}
            />
            Python
          </label>
        </div>
        <div>
          <button type="button" onClick={handleEnroll}>
            Enroll Student
          </button>
          <button type="button" onClick={handleClear}>
            Clear
          </button>
        </div>
      </form>
      </div>

      {/* Display the form data */}
      <div className='enroll-student'>
        <h2>Enrolled Student Information:</h2>
        <pre>{JSON.stringify(formData, null, 2)}</pre>
      </div>
    </div>
  );
};

export default App;
